import React from "react";

export default function Navbar({ darkMode, setDarkMode }) {
  return (
    <nav className="fixed top-0 w-full bg-darkBlue dark:bg-black bg-opacity-90 backdrop-blur-md shadow z-50">
      <div className="max-w-6xl mx-auto flex justify-between items-center py-4 px-6">
        <h1 className="text-2xl font-bold text-purple-400">MyPortfolio</h1>

        <ul className="hidden md:flex space-x-8 text-gray-300">
          <li><a href="#hero" className="hover:text-purple-400 cursor-target">Home</a></li>
          <li><a href="#about" className="hover:text-purple-400 cursor-target">About</a></li>
          <li><a href="#projects" className="hover:text-purple-400 cursor-target">Projects</a></li>
          <li><a href="#chatbot" className="hover:text-purple-400 cursor-target">Chatbot</a></li>
          <li><a href="#footer" className="hover:text-purple-400 cursor-target">Contact</a></li>
        </ul>

        <button
          onClick={() => setDarkMode(!darkMode)}
          className="ml-6 bg-purple-600 hover:bg-purple-500 text-white px-3 py-1 rounded cursor-target"
        >
          {darkMode ? "Light" : "Dark"}
        </button>
      </div>
    </nav>
  );
}
